import React from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import './css/About.css';
import Typography from '@material-ui/core/Typography';
import {withStyles, createStyles} from '@material-ui/styles';
import Navigation from './navigation';
import Contact from './contact';
import StyledProps from './StyledProps';
import Avatar from '@material-ui/core/Avatar';
import nateshim from './static/nateshim.jpg';

const About = (props: StyledProps) => {
  const classes = props.classes;
  return (   
    <Box className={classes.backgroundContainer}>
      <Navigation/>
      <Container className={classes.section} maxWidth={false}>
        <Typography className={classes.text}>Hello</Typography>
      </Container>
      <Container className={classes.bio} maxWidth={false}>
        <Avatar variant="circle" className={classes.avatar} src={nateshim}></Avatar>
        <Typography className={classes.bioTitle}>Hello</Typography>
        <Typography className={classes.text}>I am a web developer based in the Bay Area.</Typography>
      </Container>
      <Container className={classes.aboutMe} maxWidth={false}>
        <Box display={{xs: 'block', sm: 'flex', md: 'flex', lg: 'flex'}}>
          <Typography className={classes.bioTitle}>About Me</Typography>
          <Box className={classes.aboutMeBox}>
            <img className={classes.gif} src={require('./static/foxplayingpiano.gif')} alt="loading..."/>
            <Typography className={classes.text}>I like to play music.</Typography>
          </Box>
          <Box className={classes.aboutMeBox}>
            <img className={classes.gif} src={require('./static/foxcomputer.gif')} alt="loading..."/>
            <Typography className={classes.text}>I like to code.</Typography>
          </Box>
          <Box className={classes.aboutMeBox}>
            <img className={classes.gif} src={require('./static/foxdrawing.gif')} alt="loading..."/>
            <Typography className={classes.text}>I like to draw.</Typography>
          </Box>
        </Box>
      </Container>
      <Contact/>
    </Box> 
  );
}

const useStyles = createStyles({
  section: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#F7F3F2',
    alignItems: 'center',
    padding: '4rem 0',

  },
  bio: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#8F8073',
    alignItems: 'center',
    padding: '6rem 0',
  },
  aboutMe: {
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#FEB954',
    justifyContent: 'center',
    padding: '4rem 0',
  },
  aboutMeBox: {
    padding: '10rem',
  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '2rem',
    textAlign: 'center',
  },
  gif: {
    height: '200px',
    width: '200px',
  },
  bioTitle: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '3rem',
    padding: '1rem',
  },
  backgroundContainer: {
    backgroundSize: 'cover',
    height: '100%',
    width: '100%',
    backgroundColor: '#F7F3F2',
    backgroundPosition: 'center',
  },
  avatar: {
    height: '300px',
    width: '300px',
  },
});

export default withStyles(useStyles)(About);
